import React,{useState,useEffect} from "react";
import axios from 'axios';
import {GET,POST} from '../api/apiAdapter';
import PageLayout from "./PageLayout";


const URL="/farming"



function Farming() {
   const [data,setData] = useState(null)

   useEffect(() => {
      GET(URL).then((response) => {
         setData(response.data)
      })
      },[] )


   return (
      <PageLayout          
      title={
         <>
            <p className='title'>Magical Seed Farming</p>
            <p className='description'>Determine marketplace,vendor, and crate profit from harvest/breeding magical crops</p>
         </>
      }

      input={
         <p>Input</p>
      }

      table={
         <p>Table</p>
      }
      />     
   )
}


export default Farming
